import { LOGOUT_USER  } from "../actions/type";
import axios from "axios";
import { GET_ERRORS } from "../actions/type";

export const Logout = () => async (dispatch) => {
    try {
      const response = await axios.post(`http://localhost:8083/auth/signout`);
      console.log("Logout response:", response.data); // Debugging
      dispatch({
        type: LOGOUT_USER,
        payload: response.data
      });
    } catch (error) {
      console.error("Logout error:", error.response.data); // Debugging
      dispatch({
        type: GET_ERRORS,
        payload: error.response.data
      });
    }
  };
